html {
  font-size: 14px;
}

/* table layout fixed */
.imds-table-fixed table {
  table-layout: fixed;
}

.imds-table-fixed th {
  vertical-align: middle;
}

.imds-table-fixed th label,
.imds-table-fixed td label {
  max-width: 100%;
  overflow-wrap: break-word;
}

.imds-table-fixed input[type="date"] {
  min-width: 4em;
  max-width: 12em;
}

.imds-table-fixed select {
  min-width: 4em;
}

